properties.description:
An array of objects that contain data for each box and whisker
component on the box plot chart.

```
[{
  series1: {
    position: 1,
    data: {
      max: 90,
      q3: 70,
      mean: 50,
      median: 50,
      q1: 30,
      min: 10,
      outliers: [5, 2]
    }
  },
  series2: {
    position: 1,
    data: {
      max: 90,
      q3: 70,
      mean: 50,
      median: 50,
      q1: 30,
      min: 10,
      outliers: [5, 2]
    }
  }
}]
```

```
 {
     "x": [0,100],
     "y": [5,50],
 }
```

For an ordinal dataset, chart extents can be set like this:
```
 {
     "x": ['low','medium','high'],
     "y": [5,50],
 }
```

